There's a mistake in the "Understanding" section regarding `search` function in `scripts.js`. Here's the bit I'm talking about:
```
Accordingly, search uses jQuery’s getJSON method to contact /search asynchronously, passing in one parameter, geo, the value of which is query. Once /search responds (however many milliseconds or seconds later), the anonymous function passed to done will be called and passed data, whose value will be whatever JSON that /search has emitted. (Though if something goes wrong, fail is instead called.) Finally called is asyncResults, to which search passes that same data so that the plugin can iterate over the places therein (assuming /search found matches) in order to update the plugin’s drop-down. Phew.```
But the `search` function looks like this:
```js
// Search database for typeahead's suggestions
function search(query, syncResults, asyncResults)
{
    // Get places matching query (asynchronously)
    let parameters = {
        q: query
    };
    $.getJSON("/search", parameters, function(data, textStatus, jqXHR) {

        // Call typeahead's callback with search results (i.e., places)
        asyncResults(data);
    });
}
```
